import React from "react";
function SideBar(props) {
    return (
    <div>
        <ul>
            <a href="#">{props.photos}</a>
            <a href="#">{props.illustrations}</a>
            <a href="#">{props.paintings}</a>
            </ul>
    </div>
    );
}


export default SideBar;
